import logo from './logo.svg';
import './App.css';
import CharactersList from './pages/CharactersList';
import { Route, Routes } from 'react-router-dom';
import Character from './pages/Character';

function App() {
  return (
    <div>
      <Routes>
        <Route exact path="/">
          <CharactersList/>
        </Route>
        <Route exact path="/:id" element={Character}/>
      </Routes>
    </div>
  );
}

export default App;
